import Navber from "./Component/navber";
import CartDetails from "./Component/Cartdetails";
import './css/style.css';
import img1 from './images/img1.jpg';
import img2 from './images/img2.jpg';
import img3 from './images/img3.jpg';
import  AlretFound  from './Component/alert';






const App = () => {


let dateCart = [
/*   {title: "HTML", discription: "Props are passed to components via HTML attributes.",  img: img1},
  {title: "css", discription: "Props are passed to components via css attributes.", img: img2},
  {title: "js", discription: "Props are passed to components via js attributes.", img: img3},  */
]; 


let printInfo = (massge) => {
 console.log("this is form " + massge)
}

let test = (read) => {
  alert(read)
}

let printValue = (e) => {
  let valueinput = e.target.value
 return (
  <ul>
    <li>valueinput</li>
  </ul>
 )
}

    return (
      <div>
      <Navber></Navber>
      <button onClick={test} className="btn btn-info  m-3">test</button>     
       <input className="p-2 m-2" onChange={printValue}></input>
        <div className="containerCrat">
        {
       
          dateCart.length > 0? (
            dateCart.map((item, index) => {
              return (
                <CartDetails key={index} title={item.title} discription={item.discription} img={item.img} clickme={printInfo}>

                </CartDetails>
              )
          })
          ) : (
          <AlretFound errorTitle={"not found cart"} color={"primary"} />
          )
        
      }
        </div>

      </div>
    )



}

export default App;
